data.value:
Subject: Used to add a subject to your mail. -------------------------------------------------------------------------------- Attachments: If there are files you want to add to the e-mail you will send, you can add your files by selecting the "Add File" button from your computer. -------------------------------------------------------------------------------- Plain Text: If the e-mail you will send does not contain any HTML code, you can send an e-mail using this field. -------------------------------------------------------------------------------- HTML: You can use this section if you are going to send an e-mail with various links, images or HTML code with your signature. The simple toolbar in the HTML section will help you add code snippets. -------------------------------------------------------------------------------- Add Name, Add Address, Add Address: These buttons on the HTML toolbar will automatically add the information of the people in the list when sending an e-mail.
The text you wrote while editing the mail will appear as follows;
Hello #*NAME*# #*VIEW*#, This mail has been sent to #*MAİL*# for informational purposes.
However, when you start sending this e-mail to those in the list, it is changed and forwarded to the address of the e-mail address. For example, the next person is "Ayşe" whose e-mail address is "ayse@ayse.com";
Hello Mrs. Ayşe, This mail has been sent to ayse@ayse.com for information purposes. -------------------------------------------------------------------------------- Add Signature to Message: You can check this box only in the HTML part. It adds your special signature, which you have edited in the "Settings" section, at the end of each mail. -------------------------------------------------------------------------------- Mail Preview: It allows you to check the e-mail you wrote before forwarding it to the ones in your list. -------------------------------------------------------------------------------- Clear: Completely clears the subject, attachments and mail fields. -------------------------------------------------------------------------------- Sending Periodically: Sends the mails to your mailing list at intervals of the seconds you specified in the "Settings" section. -------------------------------------------------------------------------------- Direct Send: Allows you to send e-mails directly to those in the list. (Here, the time between e-mails may vary depending on the speed of your internet connection) -------------------------------------------------------------------------------- E-Mail List to Send Messages: In this field, the addresses to be sent mail after making the last changes and filters are listed.
